// Pages/Home1.js
import React, { useState, useEffect } from "react";
import axios from "axios";

function Home1() {
  const [osis, setOsis] = useState([]);
  const [name, setName] = useState("");
  const [role, setRole] = useState("");
  const [age, setAge] = useState("");

  useEffect(() => {
    axios.get("http://localhost:5000/api/osis")
      .then(response => setOsis(response.data))
      .catch(error => console.log(error));
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();

    const newOsis = { name, role, age };

    axios.post("http://localhost:5000/api/osis", newOsis)
      .then(response => setOsis([...osis, response.data]))
      .catch(error => console.log(error));

    setName("");
    setRole("");
    setAge("");
  };

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-6">Data Pengurus OSIS</h1>
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md max-w-lg mx-auto mb-6">
        <div className="mb-4">
          <input
            type="text"
            placeholder="Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <div className="mb-4">
          <input
            type="number"
            placeholder="Age"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
            className="w-full p-2 border border-gray-300 rounded-lg"
          />
        </div>
        <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded-lg hover:bg-blue-600">Add</button>
      </form>
      <ul className="max-w-lg mx-auto bg-white p-6 rounded-lg shadow-md">
        {osis.map((o) => (
          <li key={o._id} className="p-4 border-b border-gray-200">
            <div className="flex justify-between">
              <span className="font-bold">{o.name}</span>
              <span>{o.role}</span>
              <span>{o.age}</span>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Home1;
